package com.example.prescription_module.services;import com.example.prescription_module.domain.MedicalHistory;import com.example.prescription_module.repositories.MedicalHistoryRepository;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;import java.util.Optional;@Servicepublic class MedicalHistoryServiceImpl implements MedicalHistoryService {    @Autowired    private MedicalHistoryRepository medicalHistoryRepository;    @Override    public List<MedicalHistory> findAll() {        return (List<MedicalHistory>) medicalHistoryRepository.findAll();    }    @Override    public Optional<MedicalHistory> findById(Long id) {        return medicalHistoryRepository.findById(id);    }    @Override    public MedicalHistory save(MedicalHistory medicalHistory) {        return medicalHistoryRepository.save(medicalHistory);    }    @Override    public MedicalHistory update(MedicalHistory medicalHistory) {        return medicalHistoryRepository.save(medicalHistory);    }    @Override    public void delete(Long id) {        medicalHistoryRepository.deleteById(id);    }}